function evaluate () {

  const s = state;
  const b = s.board;

  var e = 0;

  features.numPieces.fill(0);

  for (let sq=0; sq<64; sq++) {

    const fr    = B88[sq];
    const frObj = b[fr];

    if (!frObj)
      continue;

    const frPiece  = objPiece(frObj);
    const frColour = objColour(frObj);
    const frIndex  = colourIndex(frColour);
    const frMult   = colourMultiplier(frColour);

    const ourPiecePSTSq  = pstSq(fr,                            frIndex)
    const ourKingPSTSq   = pstSq(s.kings[frIndex],              frIndex)
    const theirKingPSTSq = pstSq(s.kings[toggleIndex(frIndex)], frIndex)

    e += EVAL_MAT [frPiece]                                * frMult;
    e += EVAL_PST [frPiece][ourPiecePSTSq]                 * frMult;
    e += EVAL_KPST[frPiece][ourPiecePSTSq][ourKingPSTSq]   * frMult;
    e += EVAL_kPST[frPiece][ourPiecePSTSq][theirKingPSTSq] * frMult;

    features.numPieces[frPiece] += frMult;
  }

  return e * colourMultiplier(s.turn);
}

