//{{{  position

function position (sb, st, sr, sep) {

  const s = state;
  const b = s.board;

  //{{{  init
  
  b.fill(EDGE);
  
  for (let i=0; i < 64; i++)
    b[B88[i]] = 0;
  
  //}}}

  //{{{  board board
  
  var sq   = 0;
  var rank = 7;
  var file = 0;
  
  for (let i=0; i < sb.length; i++) {
  
    const ch   = sb.charAt(i);
    const sq88 = (7-rank) * 8 + file;
    const sq   = B88[sq88];
  
    switch (ch) {
      //{{{  1-8
      
      case '1':
        file += 1;
        break;
      case '2':
        file += 2;
        break;
      case '3':
        file += 3;
        break;
      case '4':
        file += 4;
        break;
      case '5':
        file += 5;
        break;
      case '6':
        file += 6;
        break;
      case '7':
        file += 7;
        break;
      case '8':
        break;
      
      //}}}
      //{{{  /
      
      case '/':
        rank--;
        file = 0;
        break;
      
      //}}}
      //{{{  black
      
      case 'p':
        b[sq] = B_PAWN;
        file++;
        break;
      case 'n':
        b[sq] = B_KNIGHT;
        file++;
        break;
      case 'b':
        b[sq] = B_BISHOP;
        file++;
        break;
      case 'r':
        b[sq] = B_ROOK;
        file++;
        break;
      case 'q':
        b[sq] = B_QUEEN;
        file++;
        break;
      case 'k':
        b[sq] = B_KING;
        s.kings[1] = sq;
        file++;
        break;
      
      //}}}
      //{{{  white
      
      case 'P':
        b[sq] = W_PAWN;
        file++;
        break;
      case 'N':
        b[sq] = W_KNIGHT;
        file++;
        break;
      case 'B':
        b[sq] = W_BISHOP;
        file++;
        break;
      case 'R':
        b[sq] = W_ROOK;
        file++;
        break;
      case 'Q':
        b[sq] = W_QUEEN;
        file++;
        break;
      case 'K':
        b[sq] = W_KING;
        s.kings[0] = sq;
        file++;
        break;
      
      //}}}
      default:
        console.log('unknown board char','|'+ch+'|');
    }
  }
  
  //}}}
  //{{{  board turn
  
  if (st == 'w')
    s.turn = WHITE;
  
  else if (st == 'b')
    s.turn = BLACK;
  
  else
    console.log('unknown board colour', spec.turn)
  
  //}}}
  //{{{  board rights
  
  s.rights = 0;
  
  for (let i=0; i < sr.length; i++) {
  
    const ch = sr.charAt(i);
  
    if (ch == 'K') s.rights |= WHITE_RIGHTS_KING;
    if (ch == 'Q') s.rights |= WHITE_RIGHTS_QUEEN;
    if (ch == 'k') s.rights |= BLACK_RIGHTS_KING;
    if (ch == 'q') s.rights |= BLACK_RIGHTS_QUEEN;
  }
  
  //}}}
  //{{{  board ep
  
  if (sep.length == 2)
    s.ep = COORDS.indexOf(sep)
  
  else
    s.ep = 0;
  
  //}}}

}

