//{{{  data files

var datafiles = [];

datafiles[0]  = 'data\\quiet-labeled-sf.epd';
datafiles[1]  = 'data\\pedantic-sf.epd';
datafiles[2]  = 'data\\eth0-sf.epd';
datafiles[3]  = 'data\\eth1-sf.epd';
datafiles[4]  = 'data\\eth2-sf.epd';
datafiles[5]  = 'data\\eth3-sf.epd';
